import React,{Component} from 'react'
import {Search_img} from './style'
import logopic from '../statics/jingdong.gif'


class Search extends Component{

  render(){
    return(
      <Search_img>
        <img src={logopic}/>
      </Search_img>
    )
  }
}

export default Search;
